// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface TRC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

interface IFlashLoanReceiver {
    function executeOperation(address asset, uint256 amount, uint256 premium, address initiator, bytes calldata params) external returns (bool);
}

contract FlashToken is TRC20 {
    string public name = "Flash Token";
    string public symbol = "FLASH";
    uint8 public decimals = 18;
    uint256 private _totalSupply = 500000000 * 10**18;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    constructor(address initialHolder) {
        _balances[initialHolder] = _totalSupply;
        emit Transfer(address(0), initialHolder, _totalSupply);
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) external view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) external override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) external override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) external override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, msg.sender, _allowances[sender][msg.sender] - amount);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "TRC20: transfer from the zero address");
        require(recipient != address(0), "TRC20: transfer to the zero address");
        require(_balances[sender] >= amount, "TRC20: transfer amount exceeds balance");

        _balances[sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "TRC20: approve from the zero address");
        require(spender != address(0), "TRC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function flashLoan(address receiver, uint256 amount, bytes calldata params) external {
        require(amount == 300 * 10**6, "Only 300 TRX flash loan");
        require(address(this).balance >= amount, "Contract has insufficient TRX");

        uint256 premium = amount * 9 / 10000; // 0.09% fee
        uint256 totalDebt = amount + premium;

        uint256 balanceBefore = address(this).balance - amount;

        // Send TRX
        payable(receiver).transfer(amount);

        // Call receiver
        require(IFlashLoanReceiver(receiver).executeOperation(address(0), amount, premium, msg.sender, params), "Flash loan execution failed");

        // Check repayment
        require(address(this).balance >= balanceBefore + totalDebt, "Repayment failed");

        // The premium stays in the contract
    }

    receive() external payable {}
}
